import React,{Component} from 'react';
import {
        ListItem,
        ListInfo,
        ListLine,
        ListAciton,
} from '../style';

class List extends Component{
    render(){
        return (
            <div>

                <ListLine/>
                <ListItem>
                        <img className="pic" alt= "" src="//upload-images.jianshu.io/upload_images/14524620-b3352a48f9e7cf13.jpg?imageMogr2/auto-orient/strip|imageView2/1/w/360/h/240"></img>
                    <ListInfo>
                        <h3 className="title">年轻、任性、脾气大的女人，但愿你能听懂舒淇讲的这段话</h3>
                        <p className="desc">文|李弯湾 放眼全世界，中国的年轻一代的女人，不说社会地位吧，光说家庭地位，应该是全球最高的之一。 如果这个描述不够准确，那么把范围在缩小一点—...</p>
                        <ListAciton>
                        <a className="action" href="/">
                        <span className="iconfont"></span>
                        极物</a>
                        <a className="action" href="/">36</a>
                        <span className="action">734</span>
                        </ListAciton>
                    </ListInfo>

                </ListItem>
            </div>

        )
    }
}

export default List;
